eval("{\nObject.defineProperty(exports, \"__esModule\", ({ value: true }));\nexports.projects = void 0;\nconst project_1 = __webpack_require__(/*! ../models/project */ \"./src/client/models/project.ts\");\nexports.projects = [\n    new project_1.Project('Pandemic Deadline', 'This app models the hypothesis testing performed on whether vaccine administration in states is correlated with infection rates. We proposed as our null hypothesis the following proposition, on a per capita basis for U.S. states over the 12 weeks observed: the proportions of state-specific Covid vaccine administration rates relative to the respective national average rate are not correlated with the proportions of state-specific total Covid case rates relative to the respective national average rate. We were able to reject our null hypothesis and found correlation in administration of vaccines with state-specific infection levels. The results of the experiment were modeled in the web application with different metrics to display the results along with a map to highlight the general picture, which allowed interactive access to the data.', '/images/pandemic.png', ['Python', 'NumPy', 'TypeScript', 'React', 'NodeJS', 'D3.Js']),\n    new project_1.Project('DeepTrex', 'A deep reinforcement learning model that can perform comparably well to an intermediate-level human player in the four-player, predominantly Middle-Eastern card game Trex. The game is relatively straightforward for a human to learn, but does have a very specific and comparatively complex structure containing a fixed number of sub-games. There are 4 Kingdoms each consisting of 5 contracts, and, glossing over the nature of the Trex contract, each contract is effectively 13 tricks. Each one requires strategy to consistently perform well. We have found it a compelling challenge to tackle because at any given time (particularly early in a round, or at any point if one doesn\\'t count cards) the game state is one of imperfect information. Thus, an initial point of interest in the project was learning to what extent a deep learning model is able to cope with the combination of, at varying times, both very constrained choices (a subset of legal moves) and more arbitrary actions (strategy)', '/images/DeepTrex.png', ['Python', 'TensorFlow', 'NumPy']),\n    new project_1.Project('Search with Cam', 'This app will grant a quick way to analyze images, instead of going through exhaustive Google searches to get descriptions of objects present. Fast RCNN is implemented to segment images and create bounding boxes. On click to the bounding boxes the information found on the objects are displayed. Users will be able to query their image using the web application for the project.', '/images/cam.png', ['Python', 'TensorFlow', 'NumPy', 'OpenCV']),\n    new project_1.Project('InTurn', 'A Web Application that gives users tools to track their job application status in a more automated way. It uses a chrome extension, which requires users to sign up using google account. After the sign-up, if filling an internship application that uses greenhouse.io, the extension will detect the application. The user information will be automatically filled through the database. After the application is submitted, the application information like job title, company, date applied, and status of your application automatically shows up in a list item in the home page of the web application. The extension captures this application automatically and puts it into the database for the current user as well. You can filter through the applications dynamically using the search bar, on the home view. Inside the home view, you can manually add new jobs and it\\'ll be added to the database and the list. You can also update the status of the added job.', '/images/inTurn.png', ['React', 'Node Express', 'TypeScript']),\n    new project_1.Project('UDDU', 'Collaborated to develop a Start-Up web application that allows users to share travel experiences, activities, and itineraries. Users could browse shared activities based on filters on the city selected. Implemented itinerary creation for users using a cyclic non-deterministic selection algorithm that tried to match preferences on criteria like budget, time, etc. The itinerary could be displayed in various ways including on a map, which was accomplished through Google Maps API. Incorporated persistent data storage for data including credentials through SQLite. Leveraged caching for recently searched activities or the cities. Data stored is user-specific, which is handled by a credential system backed by Passport.js.', '/images/UDDU.png', ['Java', 'TypeScript', 'React', 'NodeJS', 'Java Spark', 'Html/CSS', 'JavaScript', 'MobX']),\n    new project_1.Project('Weenix', 'A Linux-like OS from scratch in C. Used S5FS as File System, which is backed by an implemented virtual file system. Implemented multithreading, essential drivers, and virtual memory for the system.', '/images/weenix.png', ['C']),\n    new project_1.Project('Maps', 'Created a navigation app that draws a map on a canvas, loaded from a database, and lets users find a way to their target. Implemented a K-D Tree to find roads that fall inside a box of 4 coordinates, or closest to a point. The roads are painted depending on the traffic values received through server, and Dijkstra implementation takes traffic into account while giving the shortest path. The road names are suggested to users as they\\'re typing with the help of my AutoCorrect implementation that relies on an implemented Trie structure.', '/images/maps.png', ['Java', 'Java Spark', 'Html/CSS', 'JavaScript', 'JQuery']),\n    new project_1.Project('Scene Recognizer', 'Created an application that recognized the scenery of an image through a bag of words representation model used with the nearest neighbor and SVM classifiers.', '/images/scene.png', ['Python', 'NumPy', 'MatPlotLib']),\n    new project_1.Project('Decision Tree', 'Machine Learning implementation of ID3 Algorithm with > 95% accuracy on test data.', '/images/decision.jpg', ['Python', 'NumPy', 'MatPlotLib']),\n    new project_1.Project('CShell', 'A personal implementation of a shell coded in C. The shell has the ability to handle unix built-in system calls, child and parent processes, command line input, as well as file handling(descriptors etc.). Additionally, the shell is also able to handle both foreground and background processes with reaping that results in no leaks.', '/images/cshell.png', ['C']),\n    new project_1.Project('Pacman', 'An implementation of the game Pacman, with increasing difficulty. Side Map transitions are enabled. The ghosts use BFS algorithm to chase Pacman, so that the game is actually challenging to users. Every Pacman feature in the classic game, such as energizer(ghosts becoming eadible and scared) is implemented as well. Object Oriented Principles, such as Polymorphism, Inheritence, Encapsulation are obeyed.', '/images/pacman.png', ['Java']),\n    new project_1.Project('DoodleJump', 'An implementation of the popular game DoodleJump, except in this we have a monkey trying to climb during halloween. The project is coded in Java, using Object-Oriented Programming principles.', '/images/doodle.png', ['Java']),\n    new project_1.Project('Database Server', 'In this project, you are able to create a simple server to manage a database of key-value pairs over a network. Multiple concurrent users are able to search for items in the database, add new entries, and remove existing entries, all while using proper lock usage to ensure no data race happens.', '/images/database.png', ['C']),\n    new project_1.Project('Feature Matcher', 'An implementation of a local feature matching algorithm, which attempts to match multiple views of real-world scene. It uses Harris Corner Detector to get interesting points, SIFT to form local descriptors and ratio or nearest neighbor test for matching.', '/images/feature.png', ['Python', 'NumPy', 'MatPlotLib']),\n    new project_1.Project('Malloc', 'A personal implementation of a dynamic memory allocator for C programs. It\\'s implemented using first-fit explicit free list approach.', '/images/malloc.png', ['C']),\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./src/client/data/projects.ts\n\n}");

